import React, { useRef, useCallback, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import Logo from './Logo';
import ThemeToggle from './ThemeToggle';
import SkipLink from './SkipLink';
import { useSticky, useMobileMenu, useClickOutside, useRouteChange, useTabTrap } from '../../hooks';
import styles from './Header.module.css';

const Header = () => {
  const isSticky = useSticky();
  const { isOpen, toggle, close } = useMobileMenu();
  const location = useLocation();
  const menuRef = useRef(null);
  const menuButtonRef = useRef(null);
  
  useClickOutside(menuRef, close);
  useRouteChange(close);
  useTabTrap(menuRef, isOpen, close);

  const handleKeyDown = useCallback((event) => {
    if (event.key === 'Escape') {
      close();
      menuButtonRef.current?.focus();
    }
  }, [close]);

  useEffect(() => {
    if (isOpen) {
      document.addEventListener('keydown', handleKeyDown);
    }
    return () => document.removeEventListener('keydown', handleKeyDown);
  }, [isOpen, handleKeyDown]);

  const menuItems = [
    { id: 815, title: "Home", path: "/", isActive: location.pathname === "/" },
    { id: 816, title: "Statistics", path: "/statistics", isActive: location.pathname === "/statistics" },
    { id: 1463, title: "Investments", path: "/investments", isActive: location.pathname === "/investments" },
    { id: 823, title: "Services", path: "/services", isActive: location.pathname === "/services" },
    { id: 818, title: "About Us", path: "/about-us", isActive: location.pathname === "/about-us" },
    { id: 819, title: "Contact Us", path: "/contact-us", isActive: location.pathname === "/contact-us" }
  ];

  return (
    <>
      <SkipLink />
      <ThemeToggle />
      <header 
        id="sticky-header" 
        className={`${styles.headerSection} ${styles['header-section--style3']} ${isSticky ? styles.headerFixed : ''}`}
      >
        <div className={styles.headerBottom}>
          <div className={styles.container}>
            <div className={styles.headerWrapper}>
              <Logo />
              <div className={`${styles.menuArea} ${styles['menu--style2']} ${isOpen ? styles.active : ''}`}>
                <nav
                  ref={menuRef}
                  role="navigation"
                  aria-label="Main navigation"
                >
                  <ul id="menu-main-menu" className={styles.menu} role="menubar">
                    {menuItems.map((item) => (
                      <li 
                        key={item.id}
                        itemScope="itemscope"
                        itemType="https://www.schema.org/SiteNavigationElement"
                        id={`menu-item-${item.id}`}
                        className={`${styles.menuItem} ${styles['menu-item']} ${styles['menu-item-type-post_type']} ${styles['menu-item-object-page']} ${item.isActive ? `${styles['current-menu-item']} ${styles['page_item']} ${styles['current_page_item']} ${styles.active}` : ''} ${styles[`menu-item-${item.id}`]} ${styles['nav-item']}`}
                        role="none"
                      >
                        <Link 
                          to={item.path}
                          title={item.title}
                          className={styles.navLinks}
                          onClick={close}
                          role="menuitem"
                          tabIndex={isOpen ? 0 : -1}
                        >
                          {item.title}
                        </Link>
                      </li>
                    ))}
                  </ul>
                </nav>
              </div>
              <div className={styles.headerAction}>
                <div className={styles.menuArea}>
                  <div className={styles.headerBtn}>
                    <Link 
                      to="/Signup-Signin"
                      className={`${styles.trkBtn} ${styles.trkBtnBorder} ${styles.trkBtnPrimary}`}
                      style={{
                        backgroundColor:'#00d094',
                        border: '1px solid #00d094'
                      }}
                    >
                      <span>Join Now</span>
                    </Link>
                  </div>
                  <button
                    ref={menuButtonRef}
                    className={`${styles.headerBar} ${styles.dLgNone} ${styles['headerBar--style2']} ${isOpen ? styles.active : ''}`}
                    onClick={toggle}
                    aria-expanded={isOpen}
                    aria-label="Toggle navigation menu"
                    aria-controls="menu-main-menu"
                  >
                    <span></span>
                    <span></span>
                    <span></span>
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>
      <main id="main-content" tabIndex="-1">
        {/* Main content will be rendered here */}
      </main>
    </>
  );
};

export default Header;
